import {  useParams } from 'react-router-dom';
function Details() {
    let { id } = useParams();
    const [country, setCountry] = useState(null)
    console.log(id)
    useEffect(() => {
        

        fetch(`https://restcountries.com/v3.1/all${id}`)
        .then(res=>res.json())
        .then(data=>{
            setCountry(data)
            console.log(data);
            console.log(country);
        })
     
    }, [])
    
  return (
      <div>
{console.log(country)}
{
    country.map(x=>
    <ul>
        <li>
            {x.name.common}
        </li>
    </ul>
    )
}

    </div>
  )
}

export default Details
